import classes from './backdrop.module.css'
import Login from './login';

function Backdrop(){
    const [state,stateval] = useState(true);

    function changeState(){
        stateval(false);
    }

    return <div className={classes.backdrop} className >
            {state&&<Login cState={changeState} className={classes.aligning}/>}
    </div>
}

export default Backdrop;
